Took part in an Extraordinary Virtual @g20org Leadersâ€™ Summit this evening. It was called by Saudi Arabia, holding the G20 Presidency this year, to discuss the COVID-19 pandemic. The outbreak has permeated and changed all the norms of our daily lives â€” including the way business is conducted.

This is a global crisis, and needs a global solution. I called on the leaders to collaborate in three areas:

1. Public health â€” helping one another fight the outbreak;
2. Our economies â€” to save businesses and our citizensâ€™ jobs; 
3. Science and research â€” to find a treatment or vaccine for COVID-19, and prepare for future pandemics.

The pandemic will eventually end, but it will not be the last one the world faces. We must learn from our experiences, and emerge stronger and more resilient from them. â€“ LHL (MCI Photo by Zinkie Aw)

